%% Step 6: 季節性除去と相関分析
% 目的：カテゴリ間の時系列相関から季節性の影響を除去し、
%       「真の関連性」がどの程度維持されるかを検証する。
%
% 入力: rawData.mat (rawData_dailySales)
% 出力: step6_results.mat

clear; clc; close all;

fprintf('========================================\n'); %[output:67b14c58]
fprintf('=== Step 6: 季節性除去分析 ===\n'); %[output:8d30b2ad]
fprintf('========================================\n'); %[output:3d32e288]

%%
%% 1. 設定
set(0, 'DefaultAxesFontName', 'MS Gothic');
set(0, 'DefaultTextFontName', 'MS Gothic');
set(0, 'DefaultAxesFontSize', 10);

baseDir = '/MATLAB Drive/DAC25';
dataDir = fullfile(baseDir, '01_Data');
outputDir = fullfile(baseDir, '03_Visualization');
if ~exist(outputDir, 'dir'), mkdir(outputDir); end

%%
%% 2. データ読み込み
fprintf('\nデータ読み込み中...\n'); %[output:029cfbf6]
load(fullfile(dataDir, 'rawData.mat'), 'rawData_dailySales');
fprintf('rawData_dailySales: %d 行\n', height(rawData_dailySales)); %[output:29a90274]

%%
%% 3. 列名を明示的に指定
date_col = 'Date';
category_col = 'MajorCategory';
qty_col = 'POSSalesVolume';

fprintf('使用列: 日付=%s, カテゴリ=%s, 数量=%s\n', date_col, category_col, qty_col); %[output:0ac1e59a]

%%
%% 4. 販売マトリックスの作成
fprintf('\n販売マトリックスを作成中...\n'); %[output:3f08bee5]

sales_data = rawData_dailySales;
uniqueDates = unique(sales_data.(date_col));
uniqueCategories = unique(sales_data.(category_col));
nDates = length(uniqueDates);
nCategories = length(uniqueCategories);

fprintf('日付数: %d, カテゴリ数: %d\n', nDates, nCategories); %[output:3e79e9f7]

% groupsummaryで集計
fprintf('集計中...\n'); %[output:857eeecd]
salesSummary = groupsummary(sales_data, {category_col, date_col}, 'sum', qty_col);

% マトリックスに変換（行:カテゴリ, 列:日付）
salesMatrix = zeros(nCategories, nDates);
for i = 1:height(salesSummary)
    catIdx = find(uniqueCategories == salesSummary.(category_col)(i));
    dateIdx = find(uniqueDates == salesSummary.(date_col)(i));
    if ~isempty(catIdx) && ~isempty(dateIdx)
        salesMatrix(catIdx, dateIdx) = salesSummary.sum_POSSalesVolume(i);
    end
end
fprintf('集計完了\n'); %[output:0bc77758]

% 販売データがないカテゴリを除外
validCats = std(salesMatrix, 0, 2) > 0;
salesMatrix = salesMatrix(validCats, :);
uniqueCategories = uniqueCategories(validCats);
nCategories = size(salesMatrix, 1);
fprintf('有効カテゴリ数: %d\n', nCategories); %[output:584ca3f9]

%%
%% 5. 元の相関行列を計算
fprintf('\n元の相関行列を計算中...\n'); %[output:1f51b483]
corrMatrix_original = corrcoef(salesMatrix');

%%
%% 6. 季節性除去（方法A: ダミー変数回帰）
fprintf('\n--- 方法A: ダミー変数回帰による季節性除去 ---\n'); %[output:07beef0e]

monthVec = month(uniqueDates);
weekdayVec = weekday(uniqueDates);
monthDummies = dummyvar(categorical(monthVec));
weekdayDummies = dummyvar(categorical(weekdayVec));

% 切片 + 月ダミー(11個) + 曜日ダミー(6個)
X = [ones(nDates, 1), monthDummies(:, 2:end), weekdayDummies(:, 2:end)];

residuals_A = zeros(nCategories, nDates);
for i = 1:nCategories
    y = salesMatrix(i, :)';
    b = regress(y, X);
    residuals_A(i, :) = (y - X * b)';
end
corrMatrix_A = corrcoef(residuals_A');

%%
%% 7. 季節性除去（方法B: 7日間移動平均）
fprintf('\n--- 方法B: 7日間移動平均による季節性除去 ---\n'); %[output:83ec3ac9]

residuals_B = zeros(nCategories, nDates);
for i = 1:nCategories
    movingAvg = movmean(salesMatrix(i, :), 7);
    residuals_B(i, :) = salesMatrix(i, :) - movingAvg;
end
corrMatrix_B = corrcoef(residuals_B');

%%
%% 8. 結果の比較と評価
fprintf('\n--- 結果の評価 ---\n'); %[output:6882f1cc]

upper_tri_mask = triu(true(nCategories), 1);
original_coeffs = corrMatrix_original(upper_tri_mask);
coeffs_A = corrMatrix_A(upper_tri_mask);
coeffs_B = corrMatrix_B(upper_tri_mask);

corr_threshold = 0.5;
high_corr_pairs_original = sum(original_coeffs >= corr_threshold);
high_corr_pairs_A = sum(coeffs_A >= corr_threshold);
high_corr_pairs_B = sum(coeffs_B >= corr_threshold);

if high_corr_pairs_original > 0
    retention_rate_A = high_corr_pairs_A / high_corr_pairs_original * 100;
    retention_rate_B = high_corr_pairs_B / high_corr_pairs_original * 100;
else
    retention_rate_A = 0;
    retention_rate_B = 0;
end

fprintf('\n========== 結果サマリ ==========\n'); %[output:70b2c757]
fprintf('元の高相関ペア数 (r>=%.1f): %d\n', corr_threshold, high_corr_pairs_original); %[output:9688862c]
fprintf('方法A後の高相関ペア数: %d (維持率: %.1f%%)\n', high_corr_pairs_A, retention_rate_A); %[output:14cf3914]
fprintf('方法B後の高相関ペア数: %d (維持率: %.1f%%)\n', high_corr_pairs_B, retention_rate_B); %[output:3161547f]
fprintf('================================\n'); %[output:634131c2]

% 季節性除去後も維持されているペアを特定
[row, col] = find(upper_tri_mask);
maintained_idx = find((original_coeffs >= corr_threshold) & (coeffs_A >= corr_threshold));

fprintf('\n--- 季節性除去後も高相関を維持するペア (方法A) ---\n'); %[output:0c7b3796]
for i = 1:min(10, length(maintained_idx)) %[output:group:6b6c14b4]
    idx = maintained_idx(i);
    r_idx = row(idx);
    c_idx = col(idx);
    fprintf('%2d. %s vs %s (除去前:%.3f -> 除去後:%.3f)\n', ... %[output:6d8dcace]
        i, string(uniqueCategories(r_idx)), string(uniqueCategories(c_idx)), ... %[output:6d8dcace]
        original_coeffs(idx), coeffs_A(idx)); %[output:6d8dcace]
end %[output:group:6b6c14b4]

%%
%% 9. 可視化
fprintf('\n結果を可視化中...\n'); %[output:20c1dda7]

fig1 = figure('Name', '季節性除去分析', 'Position', [50 50 1800 1200]); %[output:7854ad97]

subplot(2, 3, 1); %[output:7854ad97]
imagesc(corrMatrix_original); %[output:7854ad97]
title('(a) 季節性除去前'); %[output:7854ad97]
axis square; colorbar; colormap('jet'); caxis([-1 1]); %[output:7854ad97]
xlabel('カテゴリ'); ylabel('カテゴリ'); %[output:7854ad97]

subplot(2, 3, 2); %[output:7854ad97]
imagesc(corrMatrix_A); %[output:7854ad97]
title('(b) 方法A後（月+曜日ダミー）'); %[output:7854ad97]
axis square; colorbar; caxis([-1 1]); %[output:7854ad97]

subplot(2, 3, 3); %[output:7854ad97]
imagesc(corrMatrix_B); %[output:7854ad97]
title('(c) 方法B後（7日移動平均）'); %[output:7854ad97]
axis square; colorbar; caxis([-1 1]); %[output:7854ad97]

subplot(2, 3, 4); %[output:7854ad97]
diff_A = coeffs_A - original_coeffs;
histogram(diff_A, 50); %[output:7854ad97]
title('(d) 方法A: 相関係数の変化'); %[output:7854ad97]
xlabel('変化量'); ylabel('ペア数'); %[output:7854ad97]
xline(mean(diff_A), 'r--', 'LineWidth', 2); %[output:7854ad97]
grid on; %[output:7854ad97]

subplot(2, 3, 5); %[output:7854ad97]
diff_B = coeffs_B - original_coeffs;
histogram(diff_B, 50); %[output:7854ad97]
title('(e) 方法B: 相関係数の変化'); %[output:7854ad97]
xlabel('変化量'); ylabel('ペア数'); %[output:7854ad97]
xline(mean(diff_B), 'r--', 'LineWidth', 2); %[output:7854ad97]
grid on; %[output:7854ad97]

subplot(2, 3, 6); %[output:7854ad97]
scatter(original_coeffs, coeffs_A, 20, 'b', 'filled', 'MarkerFaceAlpha', 0.5); %[output:7854ad97]
hold on; %[output:7854ad97]
scatter(original_coeffs, coeffs_B, 20, 'r', 'filled', 'MarkerFaceAlpha', 0.5); %[output:7854ad97]
plot([-1 1], [-1 1], 'k--', 'LineWidth', 1); %[output:7854ad97]
xline(corr_threshold, 'g--'); %[output:7854ad97]
yline(corr_threshold, 'g--'); %[output:7854ad97]
title('(f) 除去前後の比較'); %[output:7854ad97]
xlabel('除去前'); ylabel('除去後'); %[output:7854ad97]
legend('方法A', '方法B', 'y=x', 'Location', 'northwest'); %[output:7854ad97]
axis square; grid on; xlim([-0.5 1]); ylim([-0.5 1]); %[output:7854ad97]

sgtitle('Step 6: 季節性除去分析', 'FontSize', 14, 'FontWeight', 'bold'); %[output:7854ad97]
saveas(fig1, fullfile(outputDir, 'Step6_Seasonality_Analysis.png')); %[output:7854ad97] %[output:8018593e]

%%
%% 10. 結果の保存
step6Results.corrMatrix_original = corrMatrix_original;
step6Results.corrMatrix_A = corrMatrix_A;
step6Results.corrMatrix_B = corrMatrix_B;
step6Results.retention_rate_A = retention_rate_A;
step6Results.retention_rate_B = retention_rate_B;
step6Results.high_corr_pairs_original = high_corr_pairs_original;
step6Results.uniqueCategories = uniqueCategories;
step6Results.salesMatrix = salesMatrix;
step6Results.uniqueDates = uniqueDates;

save(fullfile(dataDir, 'step6_results.mat'), 'step6Results');
fprintf('\n結果を保存: %s\n', fullfile(dataDir, 'step6_results.mat')); %[output:9759fbe0]

fprintf('\n========================================\n'); %[output:1d9b8bfe]
fprintf('=== Step 6 完了 ===\n'); %[output:9e9a1efc]
fprintf('========================================\n'); %[output:7d956b2f]

